import React from "react";
import { Outlet, useNavigate } from "react-router-dom";
import NavBar from "./NavBar";

const Home = () => {
  const navigate = useNavigate();

  const placee = () => {
    navigate("/order", { replace: true });
  };
  return (
    <>
      {/* <h1>Home Page</h1> */}
      <NavBar />
      {/* <Outlet /> */}
      <button onClick={placee}>Place Order</button>
    </>
  );
};

export default Home;
